import React from 'react';
import { withRouter } from 'react-router-dom';
import {connect} from 'react-redux';

const SelectedMovie = () => {
  let movieShowtimes = {}
  props.selectedMovie.showtimes.forEach(theatre => {
    if(movieShowtimes.hasOwnProperty([theatre.theatre.id])){
    movieShowtimes[theatre.theatre.id].push(theatre.showtime)
    }
  })
return(
    <h1>your face</h1>
)
};

const mapState = (state) => {
  return {
    selectedMovie: state.selectedMovie
  }
};

export default withRouter(connect(mapState)(SelectedMovie));
